import dashboardIcon from '../assets/icon.svg';
import addIcon from '../assets/add.svg';

export const menuItems = [
    {
        path: '/',
        icon: dashboardIcon,
        label: 'Dashboard',
        id: 'dashboard',
    },
    {
        path: '/add',
        icon: addIcon,
        label: 'Add task',
        id: 'add',
    },
]
